css:
.deprecation-cop-status .icon.icon-alert:before {
  width: 17px;
}
.deprecation-cop {
  overflow: auto;
  -webkit-flex: 1;
  background-color: #cad8db !important;
}
.deprecation-cop .deprecation-overview {
  padding: 2rem 1rem 2rem 1rem;
}
.deprecation-cop .deprecation-overview .check-for-update {
  margin-top: -0.5rem;
}
.deprecation-cop .deprecation-info {
  padding: 0 1rem;
}
.deprecation-cop .deprecation-info:hover {
  background-color: #cad8db !important;
}
.deprecation-cop .deprecation-detail.list-item {
  white-space: normal;
  clear: both;
}
.deprecation-cop .deprecation-detail.list-item .deprecation-message {
  padding: 5px 0 5px 28px;
  line-height: 1.4;
  font-size: 12px;
}
.deprecation-cop .deprecation-detail.list-item .deprecation-message p:last-child {
  margin-bottom: 0;
}
.deprecation-cop .deprecation-detail.list-item .icon-alert {
  margin-top: 5px;
  float: left;
}
.deprecation-cop .collapsed > ul {
  display: none;
}
.deprecation-cop .list {
  list-style-type: none;
  padding: 0;
}
.deprecation-cop .stack-trace {
  background-color: #cad8db;
  padding: 1rem;
  margin-bottom: 1rem;
}
.deprecation-cop a {
  color: #0b2c32;
}
